import React from "react"

export default function Country(props){
    console.log(props.continent.name)
    return(
        <div>
            {props.active === "Continent" ? <h1>{props.continent.name}</h1> : ''}
            {props.active === "Language" ? <h1>{props.languages[0].name}</h1> : ''}
        </div>
    )
}
